import React from 'react';
import Nav from '../task/Nav';

const Project = () => {
 

  return (
    <div>
      <Nav />
      <section>
        <h2>Projects</h2>
        <ul>
          {projects.map((project, index) => (
            <li key={index}>
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <a href={project.link} target="_blank" rel="noopener noreferrer">View on GitHub</a>
            </li>
          ))}
        </ul>
      </section>
    </div>
  );
};

export default Project;
